import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">

      <h1>{fetch('api.openweathermap.org/data/2.5/weather?q=Lisbon&appid=4c77efd9f8291e2531b89885b49ca00e')
            .then(function(response){
              return response.json();
            })
            .then(function(response){
              console.log(response.main.temp)
            })
          }</h1>

    </div>
  );
}

export default App;
